import React, {useEffect} from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  const [titulo, setTitulo] = React.useState(null);
  const [lideresEquipo, setLideresEquipo] = React.useState(null);

  useEffect(() => {
    fetch("/titulo")
      .then((res) => res.json())
      .then((titulo) => setTitulo(titulo.message));
  }, []);

  function obtenerLideresEquipo(){
    fetch("/supervisor")
      .then((res) => res.json())
      .then((lideresEquipo) => setLideresEquipo(lideresEquipo.message));
  }

  return (
    <div className="App">
      <header className="App-header">
        <p>{!titulo ? "Cargando..." : titulo}</p>
      </header>
      <div className="App-subheader">
        <h1>Identificador de colaboradores</h1>
      </div>
      <div className="App-body">
        <div className="body-menu">
        <div onClick={obtenerLideresEquipo()}>
        Ver todos los lideres de equipo
        </div>
        <div>
        Buscar lider de equipo
        </div>
        <div>
        Ver todos los empleados
        </div>
        <div>
        Crear nuevo colaborador
        </div>
        <div>
        Actualizar colaborador
        </div>
        </div>
        <div className="body-interfaz">
          <a>Debe seleccionar una opcion...</a>
        </div>
      </div>
    </div>
  );
}

export default App;
